import React from 'react'; // React
import AtlasModal, { ModalTransition } from '@atlaskit/modal-dialog'; // Atlaskit Modal
import styles from 'styles/components/Modal.module.css'; // Component styles

// Modal dialog
export default function Modal({
  children,
  heading = 'heading',
  open = true,
  cancelText = 'Cancel',
  submitText = 'Submit',
}) {
  return (
    <ModalTransition>
      {open && (
        <AtlasModal
          actions={[
            { text: cancelText, className: 'modal__footer_cancel-button' },
            { text: submitText },
          ]}
          heading={heading}
        >
          AtlasModal
        </AtlasModal>
      )}
    </ModalTransition>
  );
}
